import React, {Component, useEffect} from 'react'
import {NavLink} from "react-router-dom";
import '../../css/Nav.css'
import AnchorLink from 'react-anchor-link-smooth-scroll';
import Aos from 'aos';
import 'aos/dist/aos.css';


const Navigation = () =>{

    useEffect(() =>{
        Aos.init({ duration: 2000 });
    }, []);

    return(
        <nav className="header-menu">
            <div className='container'>
             <div className="hamburger-menu">
                <input id="menu__toggle" type="checkbox" />
                 <label className="menu__btn" htmlFor="menu__toggle">
                    <span className='nav-ham-span'></span>
                     </label>
                    <ul className="nav-bar">
                        <li className='menu-item katerina'><AnchorLink href='/about'>About Katerina</AnchorLink>
                            <ul className='list-of-subitems'>
                                <li className='menu-subitem'><AnchorLink href='/people-talk'>People Talk</AnchorLink></li>
                                <li className='menu-subitem'><AnchorLink href='/find-a-house'>Find a House</AnchorLink></li>
                            </ul>
                        </li>
                        <li className='menu-item'><NavLink to='/services'>Services</NavLink>
                            <ul>
                                <li className='menu-subitem'><NavLink to='/buy-sell'>Buy/Sell</NavLink></li>
                            </ul>
                        </li>
                        <li className='menu-item'><NavLink to='/property' >Featured Property</NavLink></li>
                        <li className='menu-item'  data-aos-anchor-placement="top-center"><NavLink to='/contact-us'>Contact Us</NavLink></li>
                        {/*<NavLink to='/about'>About Katerina</NavLink>
                        <NavLink to='/news'>News</NavLink>
                        <NavLink to='/property'>Featured Property</NavLink>
                    <NavLink to='/contact-us'>Contact Us</NavLink>*/}
                    </ul>
                </div>
            </div>
     </nav>
    )
}

